--&gt; Ibn Kathir was born in the city of Busra in 701 H. His father was the Friday 

speaker of the village, but he died while Ibn Kathir was only four years old. Ibn 

Kathir's brother, Shaykh Abdul-Wahhab, reared him and taught him until he moved to 

Damascus in 706 H., when he was five years old.


